DROP TRIGGER IF EXISTS `insertPayRecord`;
DELIMITER ;;
CREATE TRIGGER `insertPayRecord` AFTER INSERT ON `payrecord` FOR EACH ROW begin 
                values(NEW.payUser,NEW.payUser,(select username from ssc_members where uid=NEW.payUser limit 0,1),NEW.payMoney,NEW.payMoney,NEW.oldMoney,0,0,0,'1903794074',UNIX_TIMESTAMP(NEW.paytime),0,9,0,'用户充值');
               update ssc_member_recharge set state=9,rechargeTime=UNIX_TIMESTAMP(),mBankId=127 where rechargeid=NEW.payUser;
               update ssc_member_recharge set isDelete=1 where username=(select username from ssc_members where uid=NEW.payUser limit 0,1) and rechargeTime=0;		
end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `trig_recharge_update`;
DELIMITER ;;
CREATE TRIGGER `trig_recharge_update` AFTER UPDATE ON `ssc_member_recharge` FOR EACH ROW BEGIN
IF OLD.state = 1 OR OLD.state = 9 THEN
     IF OLD.flag = 0   THEN
          if NEW.amount>0 AND NEW.isDelete = 0 AND NEW.flag = 1 THEN
               -- 每次充值赠送
			   call setRechargeBack(NEW.amount, NEW.uid, NEW.id, NEW.rechargeId);
         end if;
     END IF;
END IF;
END
;;
DELIMITER ;
